int is_letter(char c)
{
	return (c >= 'a' && c <= 'z') || (c >= 'A' && c <= 'Z') || (c >= '0' && c <= '9') || c == '.' || c == '_' || c == '-';
}

int is_hex(char c)
{
	return (c >= '0' && c <= '9') || (c >= 'a' && c <= 'f');
}

int hex2dec(char c)
{
	if (c >= '0' && c <= '9') { return c - '0'; }
	else { return c - 'a' + 10; }
}

