int valid_utf8_char(const char *str)
{
	unsigned char c = (unsigned char) *str;
	int n = 0;

	if ((c & 0x80) == 0x00) {
		n = 0;
	} else if ((c & 0xe0) == 0xc0) {
		n = 1;
	} else if ((c & 0xf0) == 0xe0) {
		n = 2;
	} else if ((c & 0xf8) == 0xf0) {
		n = 3;
	} else if ((c & 0xfc) == 0xf8) {
		n = 4;
	} else if ((c & 0xfe) == 0xfc) {
		n = 5;
	} else {
		return -1;
	}

	int i;
	for (i = 0; i < n; i ++) {
		if ((((unsigned char)(str[i + 1])) & 0xc0) != 0x80) {
			return -1;
		}
	}
	return n + 1;
}


void print_escaped_string(const char *str, int len)
{
	eprintf ("\"");
	const char *end = str + len;
	while (str < end) {
		int n = valid_utf8_char (str);
		if (n < 0) {
			eprintf ("\\x%02x", (int)(unsigned char)*str);
			str ++;
		} else if (n >= 2) {
			int i;
			for (i = 0; i < n; i++) {
				eprintf ("%c", *(str ++));
			}
		} else if (((unsigned char)*str) >= ' ' && *str != '"' && *str != '\\') {
			eprintf ("%c", *str);
			str ++;
		} else {
			switch (*str) {
			case '\n':
				eprintf("\\n");
				break;
			case '\r':
				eprintf("\\r");
				break;
			case '\t':
				eprintf("\\t");
				break;
			case '\b':
				eprintf("\\b");
				break;
			case '\a':
				eprintf("\\a");
				break;
			case '\\':
				eprintf ("\\\\");
				break;
			case '"':
				eprintf ("\\\"");
				break;
			default:
				eprintf ("\\x%02x", (int)(unsigned char)*str);
				break;
			}
			str ++;
		}
	}
	eprintf ("\"");
}

void expand_backslashed(char *s, int len)
{
	int backslashed = 0;
	exp_buffer_pos = 0;
	int i = 0;
	while (i < len) {
		assert (i + 3 <= (1 << 25));
		if (backslashed) {
			backslashed = 0;
			switch (s[i ++]) {
			case 'n':
				exp_buffer[exp_buffer_pos ++] = '\n';
				break;
			case 'r':
				exp_buffer[exp_buffer_pos ++] = '\r';
				break;
			case 't':
				exp_buffer[exp_buffer_pos ++] = '\t';
				break;
			case 'b':
				exp_buffer[exp_buffer_pos ++] = '\b';
				break;
			case 'a':
				exp_buffer[exp_buffer_pos ++] = '\a';
				break;
			case '\\':
				exp_buffer[exp_buffer_pos ++] = '\\';
				break;
			case 'x':
				if (i + 2 > len || !is_hex(s[i]) || !is_hex (s[i + 1])) {
					exp_buffer_pos = -1;
					return;
				}
				exp_buffer[exp_buffer_pos ++] = hex2dec (s[i]) * 16 + hex2dec(s[i + 1]);
				i += 2;
				break;
			default:
				break;
			}
		} else {
			if (s[i] == '\\') {
				backslashed = 1;
				i ++;
			} else {
				exp_buffer[exp_buffer_pos ++] = s[i ++];
			}
		}
	}
}

